import base64
import re
from io import BytesIO

from time import sleep

from PIL import Image
from zhon.hanzi import punctuation
from app.core.model.meta_data import MetaData
from app.plugins.mdtv import config
from app.plugins.mdtv.browser_tools import BrowserTools
from app.plugins.mdtv.config import get_info
from app.tools.cache_tools import check_cache
from app.tools.log_tools import log

URL = 'http://mdtv013.com/'

actor_placeholder = ['',
                     '']
def search(meta_info, user_setting):
    plugin_name = config.get_info('en').get('name')
    meta_data_list = []
    video_title = meta_info.get('video_title')
    part_file = meta_info.get('part_file')
    movie_type = ''
    title_style = ''
    log('info', 'title:%s' % video_title, plugin_name)

    # code is the formatted media name which is used to check if it is already in cache
    video_title = meta_info.get('video_title')

    pattern = re.compile(r'[\u4e00-\u9fa5]')
    code = re.sub(pattern, "", video_title)  # 
    code = re.sub('[{}]'.format(punctuation), "", code)  # 

    cache_data = check_cache(code, get_info('en').get('name'))
    if cache_data:
        for item in cache_data:
            meta_data_list.append(item)
    else:
        # search for meta data from internet
        meta_data = search_on_model(code)
        if meta_data:
            meta_data_list.append(meta_data)
    return meta_data_list


def search_on_model(code):
    meta_data = None
    browserTools = BrowserTools()
    browser = browserTools.get_browser()
    browser.get(URL)
    browser.find_element_by_xpath('/html/body/div/div/section/div/div[2]/div[2]/button').click()

    search_url = URL + '/search?keyword=' + code
    browser.get(search_url)

    sleep(4)  # Time in seconds
    result = '//*[@id="pane-"]/div/div'
    if len(browser.find_elements_by_xpath(result)) == 0:
        return meta_data
    meta_data = MetaData()

    browser.find_elements_by_xpath('/html/body/div/div/section/main/div/div[1]/div/div[2]/div[1]/div/div/div/a')[0].click()

    post = browser.find_elements_by_xpath('//*[@id="MD-VIDEO_html5_api"]')
    refresh_count = 0
    while len(post) == 0 and refresh_count < 10:
        post = browser.find_elements_by_xpath('//*[@id="MD-VIDEO_html5_api"]')
        sleep(1)
        refresh_count += 1
    post = post[0].screenshot_as_base64
    meta_data.poster = picture_to_base64(process_image(post))
    meta_data.thumbnail = post
    title = browser.find_elements_by_xpath('//*[@id="__layout"]/section/main/div[1]/div/div[1]/div[2]/h1')[0].text
    meta_data.title = code + ' ' + title
    meta_data.code = code
    meta_data.studio = 'model media'
    summary = browser.find_elements_by_xpath('//*[@id="__layout"]/section/main/div[1]/div/div[1]/div[2]/p')
    if len(summary) > 0:
        meta_data.summary = summary[0].text
    year = browser.find_elements_by_xpath('//*[@id="__layout"]/section/main/div[1]/div/div[1]/div[2]/ul[2]/li[3]/span[2]')[0].text
    if len(year) >= 4:
        meta_data.year = year[:4]
        meta_data.originally_available_at = year[:4]

    actor_dic = {}
    actors = browser.find_elements_by_xpath('/html/body/div/div/section/main/div[1]/div/div[1]/div[2]/ul[2]/li[1]/span/a')
    actors_str = []
    for actor in actors:
        actors_str.append(actor.text)
    for actor in actors_str:
        image_code = get_actor_pic(browser, actor)
        actor_dic.update({actor: image_code})
    meta_data.actor = actor_dic
    browserTools.close_browser()
    return meta_data


def process_image(base64_code):
    img = Image.open(BytesIO(base64.b64decode(base64_code)),)
    # (left, upper, right, lower)
    w = int(600)
    h = int(1000)
    newim = Image.new('RGB', (w, h), 'black')
    picW, picH = img.size
    newim.paste(img.resize((int(w), int(w / picW * picH))), (0, int((h - w / picW * picH) / 2)))
    cropped = newim
    return cropped


def picture_to_base64 (img):
    output_buffer = BytesIO()
    img = img.convert('RGB')
    img.save(output_buffer, format='JPEG')
    byte_data = output_buffer.getvalue()
    base64_str = base64.b64encode(byte_data)
    return base64_str.decode("utf-8")


def get_actor_pic(browser, name):
    search_url = URL + 'search/?keyword=' + name + '&type=%E7%9B%B8%E5%85%B3%E5%A5%B3%E4%BC%98&pageNum=1'
    browser.get(search_url)
    image = browser.find_elements_by_xpath('//*[@id="pane-"]/div/div/div/a')
    refresh_count = 0
    while len(image) == 0 and refresh_count < 5:
        image = browser.find_elements_by_xpath('//*[@id="pane-"]/div/div/div/a')
        sleep(1)
        refresh_count += 1
    if len(image) > 0:
        refresh_count = 0
        while image[0].screenshot_as_base64 in actor_placeholder and refresh_count < 20:
            image = browser.find_elements_by_xpath('//*[@id="pane-"]/div/div/div/a')
            sleep(1)
            refresh_count += 1
        return image[0].screenshot_as_base64
    else:
        return actor_placeholder[1]
